import React, { Component } from 'react';
import './SortController.css'

class SortController extends Component{
    render(){
        return(
            <div className = "nav">
                <button className = "nav-item">Reset Array</button>
                <button className = "nav-item">Buble Sort</button>
                <button className = "nav-item">Insertion Sort</button>
                <button className = "nav-item">Selection Sort</button>
                <button className = "nav-item">Merge Sort</button>
                <button className = "nav-item">Quick Sort</button>

            </div>
        )
    }
}

export default SortController;
